import React, { Component } from 'react';
import './App.css';

import Header from './components/Header';
import ChartOne from './components/ChartOne';
import ChartTwo from './components/ChartTwo';

class App extends Component {
  render() {
    return(
      <div className="App">
        <Header />
        <ChartOne /> <ChartTwo />
      </div>
    );
  }
}

export default App;
